'use strict';var splitLayoutProps=require('../splitLayoutProps').default;test('splits style objects',function(){var style={width:10,margin:20,padding:30,transform:{scaleY:-1}};var _splitLayoutProps=splitLayoutProps(style),outer=_splitLayoutProps.outer,inner=_splitLayoutProps.inner;expect(outer).toMatchInlineSnapshot("\n    Object {\n      \"margin\": 20,\n      \"transform\": Object {\n        \"scaleY\": -1,\n      },\n      \"width\": 10,\n    }\n  ");expect(inner).toMatchInlineSnapshot("\n    Object {\n      \"padding\": 30,\n    }\n  ");});test('does not copy values to both returned objects',function(){var style={marginVertical:5,paddingHorizontal:10};var _splitLayoutProps2=splitLayoutProps(style),outer=_splitLayoutProps2.outer,inner=_splitLayoutProps2.inner;expect(outer).toMatchInlineSnapshot("\n    Object {\n      \"marginVertical\": 5,\n    }\n  ");expect(inner).toMatchInlineSnapshot("\n    Object {\n      \"paddingHorizontal\": 10,\n    }\n  ");});test('returns null values if argument is null',function(){var _splitLayoutProps3=splitLayoutProps(null),outer=_splitLayoutProps3.outer,inner=_splitLayoutProps3.inner;expect(outer).toBe(null);expect(inner).toBe(null);});